import React, { useState } from 'react'
import MeditationData from './static/MeditationData';

function Meditation() {
    const [data, setData] = useState(MeditationData);
    return (
        <div>
            {data.map((el) => <div key={el.id}>
                <h4>{el.title}</h4>
            </div>
            )}
        </div>
    )
}

export default Meditation
